var input = @"";

const int markerLength = 14;
var lastCharacters = new List<char>();
var processed = 0;

foreach (var character in input)
{
    if (lastCharacters.Count == markerLength)
    {
        if (lastCharacters.DistinctBy(c => c).Count() == markerLength)
        {
            Console.WriteLine(processed);
            break;
        }
        lastCharacters.RemoveAt(0);
    }

    lastCharacters.Add(character);
    processed++;
}
